import React from "react";
import styled from "styled-components";



const CompletedDiv = styled.div`{
cursor: pointer;
color: ${props => props.complete ? "black" : "white"};
}`


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
    console.log(track.status)
  }
  return (
    <>
      <CompletedDiv
        id={track.id}
        name={track.status.complete}
        value={track.id}
        status={track.status}
        onClick={handleClick}
        complete={track.status}
      >
        {track.title}
      </CompletedDiv >

    </>
  );



};

export default Track;
